import React, { useState, useEffect } from "react";
import APIStored from "../components/API/APIStored";

function TestingAPI() {
  const [data, setData] = useState([]);
  console.log(
    data.map((item) => {
      JSON.stringify(item[1]);
    })
  );
  useEffect(() => {
    APIStored()
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => console.error("Error", error));
  }, []);

  return (
    <div>
      <table border="1">
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Password</th>
            <th>Mobile</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.first_Name}</td>
              <td>{item.last_Name}</td>
              <td>{item.email}</td>
              <td>{item.password}</td>
              <td>{item.mobile}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TestingAPI;
